import React, { Component } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import NavBar from './components/NavBar/NavBar';


class App extends Component {
  state = {
    login: false,
    userid: '',
    name: null,
  }

  changeStatus = val => {
    this.setState({
      login: true,
      userid: val.user_id,
      name: val.name,
    });
  }

  render() {
    return (
      <Router>
        <div>
          <NavBar login={this.state.login} userid={this.state.userid} name={this.state.name} changeStatus={this.changeStatus}/>
        </div>
      </Router>

    );
  }
}

export default App;
